import React from "react";
import Button from "@material-ui/core/Button";
import Paper from "@material-ui/core/Paper";
import { withStyles } from "@material-ui/core/styles";
import { greeting } from "./GreetingStyles";
import CssBaseline from "@material-ui/core/CssBaseline";
import { Link } from "react-router-dom";

const Greeting = (props) => {
  const { classes } = props;
  const styles = {
    margin: "auto",
    width: "50%",
    marginTop: "50px",
  };
  return (
    <div style={styles}>
      <CssBaseline />
      <Paper className={classes.paper}>
        <h1>Welcome to the LEVEL UP APP!</h1>
        <h4>
          This app is super simple to use, and may help you in pushing you
          towards your goals! See the about page for more details or signup to
          start leveling up!
        </h4>
        <div>
          <Link to="/login">
            <Button variant="outlined" className={classes.button}>
              Login
            </Button>
          </Link>
          <Link to="/register">
            <Button variant="outlined" className={classes.button}>
              Register
            </Button>
          </Link>
          <Link to="/about">
            <Button variant="outlined" className={classes.button}>
              About
            </Button>
          </Link>
        </div>
      </Paper>
    </div>
  );
};

export default withStyles(greeting)(Greeting);
